PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE alde_run (
	id INTEGER NOT NULL, 
	name VARCHAR(100), 
	descrip VARCHAR(500), 
	num_rounds INTEGER NOT NULL, 
	num_variants INTEGER NOT NULL, 
	num_variants_first_round INTEGER NOT NULL, 
	num_top_acq_var_per_round INTEGER NOT NULL, 
	num_top_pred_var_per_round INTEGER NOT NULL, 
	batch_size INTEGER NOT NULL, 
	test_fraction FLOAT NOT NULL, 
	random_seed INTEGER NOT NULL, 
	max_assay_score FLOAT NOT NULL, 
	binary_score_cutoff FLOAT, 
	start_ts DATETIME, 
	end_ts DATETIME, 
	PRIMARY KEY (id)
);
CREATE TABLE alde_sub_run (
	id INTEGER NOT NULL, 
	run_id INTEGER, 
	model_name VARCHAR(50) NOT NULL, 
	model_parameters VARCHAR, 
	first_round_strategy VARCHAR(100) NOT NULL, 
	first_round_strategy_params VARCHAR, 
	strategy VARCHAR(100) NOT NULL, 
	strategy_parameters VARCHAR, 
	start_ts DATETIME, 
	end_ts DATETIME, 
	PRIMARY KEY (id), 
	FOREIGN KEY(run_id) REFERENCES alde_run (id)
);
CREATE TABLE alde_simulation (
	id INTEGER NOT NULL, 
	sub_run_id INTEGER, 
	simulation_num INTEGER NOT NULL, 
	start_ts DATETIME, 
	end_ts DATETIME, 
	PRIMARY KEY (id), 
	FOREIGN KEY(sub_run_id) REFERENCES alde_sub_run (id)
);
CREATE TABLE alde_round (
	id INTEGER NOT NULL, 
	simulation_id INTEGER, 
	round_num INTEGER NOT NULL, 
	train_rmse FLOAT, 
	train_r2 FLOAT, 
	train_spearman FLOAT, 
	validation_rmse FLOAT, 
	validation_r2 FLOAT, 
	validation_spearman FLOAT, 
	test_rmse FLOAT, 
	test_r2 FLOAT, 
	test_spearman FLOAT, 
	spearman FLOAT, 
	top_n_mean FLOAT, 
	best_variant_id INTEGER, 
	start_ts DATETIME, 
	end_ts DATETIME, 
	PRIMARY KEY (id), 
	FOREIGN KEY(simulation_id) REFERENCES alde_simulation (id)
);
CREATE TABLE alde_round_acquired_variant (
	id INTEGER NOT NULL, 
	round_id INTEGER, 
	variant_id INTEGER NOT NULL, 
	variant_name VARCHAR(100), 
	assay_score FLOAT, 
	prediction_score FLOAT, 
	acquisition_score FLOAT, 
	top_acquisition_score BOOLEAN, 
	top_prediction_score BOOLEAN, 
	insert_ts DATETIME, 
	PRIMARY KEY (id), 
	CONSTRAINT uix_round_variant UNIQUE (round_id, variant_id), 
	FOREIGN KEY(round_id) REFERENCES alde_round (id)
);
CREATE TABLE alde_round_top_variant (
	id INTEGER NOT NULL, 
	round_id INTEGER, 
	variant_id INTEGER NOT NULL, 
	variant_name VARCHAR(100), 
	assay_score FLOAT, 
	prediction_score FLOAT, 
	insert_ts DATETIME, 
	PRIMARY KEY (id), 
	CONSTRAINT uix_round_top_variant UNIQUE (round_id, variant_id), 
	FOREIGN KEY(round_id) REFERENCES alde_round (id)
);
CREATE TABLE run_id(id integer primary key);
CREATE TABLE perf_stats(
  run_id INT,
  name TEXT,
  round_num INT,
  mean_fha,
  mean_fha_rank,
  mean_activity,
  mean_activity_rank,
  max_activity,
  max_activity_rank,
  train_rmse,
  train_rmse_rank,
  train_r2,
  train_r2_rank,
  train_spearm,
  train_spearm_rank,
  val_rmse,
  val_rmse_rank,
  val_r2,
  val_r2_rank,
  val_spearm,
  val_spearm_rank,
  total_rank
);
COMMIT;
